// Home.jsx
import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home-container">
      <div className="home-overlay"></div> {/* Overlay for readability */}
      <div className="home-content">
        <h1>We provide medical services that you can trust!</h1>
        <h2>Your health is our priority. We care for you like family.</h2>
      </div>
    </div>
  );
}

export default Home;
